def fibonacci_iterative(n):
  """Prints the Fibonacci series up to n terms."""
  a, b = 0, 1
  if n <= 0:
    return
  elif n == 1:
    print(a)
  else:
    print(a)
    print(b)
    for i in range(2, n):
      c = a + b
      print(c)
      a, b = b, c

fibonacci_iterative(10)  # Prints the first 10 Fibonacci numbers
